/**
 *  PlasmaGigaTheme.Inverse
 */
@Composable
public fun PlasmaGigaTheme.Inverse(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable
    () -> Unit,
) {
    val colors = if (isDark) {
        darkInverseColors
    } else {
        lightInverseColors
    }
    val gradients = if (isDark) {
        darkInverseGradients
    } else {
        lightInverseGradients
    }
    PlasmaGigaTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
